// https://on.cypress.io/blob
cy.get(".utility-blob").then(function ($div) {
  // https://github.com/nolanlawson/blob-util#imgSrcToDataURL
  // get the dataUrl string for the javascript-logo
  return Cypress.Blob.imgSrcToDataURL("https://example.cypress.io/assets/img/javascript-logo.png", undefined, "anonymous").then(function (dataUrl) {
    // create an <img> element and set its src to the dataUrl
    var img = Cypress.$("<img />", {
      src: dataUrl
    }); // need to explicitly return cy here since we are initially returning
    // the Cypress.Blob.imgSrcToDataURL promise to our test
    // append the image
    $div.append(img);
    cy.get(".utility-blob img").click().should("have.attr", "src", dataUrl);
  });
});

// https://on.cypress.io/minimatch
var matching = Cypress.minimatch("/users/1/comments", "/users/*/comments", {
  matchBase: true
});
expect(matching, "matching wildcard").to.be["true"];
matching = Cypress.minimatch("/users/1/comments/2", "/users/*/comments", {
  matchBase: true
});
expect(matching, "comments").to.be["false"]; // ** matches against all downstream path segments
matching = Cypress.minimatch("/foo/bar/baz/123/quux?a=b&c=2", "/foo/**", {
  matchBase: true
});
expect(matching, "comments").to.be["true"]; // whereas * matches only the next path segment
matching = Cypress.minimatch("/foo/bar/baz/123/quux?a=b&c=2", "/foo/*", {
  matchBase: false
});
expect(matching, "comments").to.be["false"];

// https://on.cypress.io/promise
var waited = false;
/**
 * @return Bluebird<string>
 */
function waitOneSecond() {
  // return a promise that resolves after 1 second
  // @ts-ignore TS2351 (new Cypress.Promise)
  return new Cypress.Promise(function (resolve, reject) {
    setTimeout(function () {
      // set waited to true
      waited = true; // resolve with 'foo' string
      resolve("foo");
    }, 1000);
  });
}
cy.then(function () {
  // return a promise to cy.then() that
  // is awaited until it resolves
  // @ts-ignore TS7006
  return waitOneSecond().then(function (str) {
    expect(str).to.eq("foo");
    expect(waited).to.be["true"];
  });
});
